import Header from '../../partials/head';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import '../index.scss'
import {
    ColoredButton,
    GlobalNavbar,
    ProjectList,
    StubsList,
    GlobalFooter,
    Divider,
    Stub
} from '../../partials/components';
import React from "react";

class SURFArchive extends React.Component {
    constructor(props) {
        super(props);
        this.state = {loading: true};
        this.projects = [{
            "title": "Hi",
            "description": "description is here"
        }];
    }

    componentDidMount() {
        this.setState({loading: false});
    }

    mainContent() {
        return (
            <div>
                <Header page_name="SURF Archive"/>
                <GlobalNavbar/>
                <div id='rundown-wrapper'>
                    <Container id='rundown-jim'>
                        <p className='nm'>SURF Archive Tool</p>
                        <div className='ds'>Search through past projects at Caltech's Summer Undergraduate Research Program</div>
                    </Container>
                </div>
                <div className='main-content'>
                    <Container>
                        {this.projects.map((value, _) => {
                            return <Stub title={value.title} text={value.description} description={value.description}/>;
                          })}
                    </Container>
                </div>
                <GlobalFooter/>
            </div>
        )
    }

    render() {

        return (
            this.mainContent()
        )
    }
}

export default SURFArchive;
